import React from 'react';
import { connect } from 'react-redux';
import {Card} from 'react-bootstrap';
import Task from '../Task/task';
import {setDoingTasks} from '../../actions/tasks';

class DoingList extends React.PureComponent
{
   render()
   {
       return(
        <Card className="DoingList_card">
        <Card.Body>
            <Card.Text> Doing </Card.Text>
            {/* <Task body="hii"></Task> */}
        </Card.Body>
        </Card>
       )
   }
}

const mapStateToProps = state => ({
    data: state.data,
  });
  
  
  const mapDispatchToProps = dispatch => ({
    setData: data => dispatch(setDoingTasks(data)),
  });
  
  
export default connect(mapStateToProps, mapDispatchToProps)(DoingList);
